import { Content, Form, Input, Page, Title } from "./styled";

export default function Login() {
  return (
    <Page>
      <Content>
        <Title>Вход</Title>
        <Form>
          <Input placeholder="Логин"/>
          <Input />
        </Form>
      </Content>
    </Page>
  );
}
